using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;
using Microsoft.AspNetCore.Http;
using Microsoft.AspNetCore.Mvc;
using ProcastinationKiller.Models;
using ProcastinationKiller.Services.Abstract;

namespace ProcastinationKiller.Controllers
{
    [Route("api/[controller]")]
    [ApiController]
    public class AdministrationController : ControllerBase
    {

        private static List<BadgeDefinition> _badgeDefinitions =
        new List<BadgeDefinition> {
            new BadgeDefinition()
            {
                AssignableFormBeggining = true,
                Conditions = new List<RewardCondition>()
                {
                    new RewardCondition()
                    {
                        Amount = 1,
                        Condition = Conditions.Logins
                    },
                },
                Image = "data:image/jpeg;base64,"
            },
            new BadgeDefinition()
            {
                AssignableFormBeggining = true,
                Conditions = new List<RewardCondition>()
                {
                    new RewardCondition()
                    {
                        Amount = 20,
                        Condition = Conditions.PointsEarned
                    },
                    new RewardCondition()
                    {
                        Amount = 1,
                        Condition = Conditions.TodosCompleted
                    },
                },
                Image = "data:image/jpeg;base64,"
            }
        };

        private readonly List<League> _leagues = new List<League>()
        {
            new League() { Name = "Iron V" },
            new League() { Name = "Iron IV" },
            new League() { Name = "Iron III" },
            new League() { Name = "Iron II" },
            new League() { Name = "Iron I" },
        };

        private readonly List<LevelDefinition> _levels = new List<LevelDefinition>()
        {
            new LevelDefinition() { Number = 1, RequiredExp = 100 },
            new LevelDefinition() { Number = 2, RequiredExp = 210 },
            new LevelDefinition() { Number = 3, RequiredExp = 340 },
            new LevelDefinition() { Number = 4, RequiredExp = 500 },
            new LevelDefinition() { Number = 5, RequiredExp = 690 },
            new LevelDefinition() { Number = 6, RequiredExp = 900 },
            new LevelDefinition() { Number = 7, RequiredExp = 1200 },
        };

        private readonly UsersContext _context;
        private readonly IRewardService _rewardService;

        public AdministrationController(UsersContext context, IRewardService rewardService)
        {
            _context = context;
            _rewardService = rewardService;
        }

        [HttpGet]
        [Route("addRewardDefinition")]
        public async Task AddRewardsDefinitions()
        {
            foreach(var definition in _badgeDefinitions)
            {
                await _context.AddAsync(definition);
            }

            await _context.SaveChangesAsync();
        }

        [HttpGet]
        [Route("addRewardsToUsers")]
        public async Task AddBaseRewardsToUser()
        {
            foreach(var user in _context.Users)
            {
                await _rewardService.AssignBaseRewards(user.UId);
            }
        }

        [HttpGet]
        [Route("addLeagues")]
        public async Task AddLeagues()
        {
            foreach(var league in _leagues)
            {
                await _context.AddAsync(league);
            }

            foreach (var level in _levels)
            {
                level.League = level.Number > 5 ? _leagues[1] : _leagues[0];
                await _context.AddAsync(level);
            }

            await _context.SaveChangesAsync();
        }
    }
}